import './App.css';
import { Home, Box } from './element';
import { BrowserRouter as Router, Route, Routes, Link, Nav } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' exactly element={<Home />} />
        <Route path='/box' exactly element={<Box />} />
      </Routes>
      <Nav>
        <div className='menu-list'>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/box">Box</Link></li>
          </ul>
        </div>
      </Nav>
    </Router>
  );
}

export default App;
